import Card from "../Card/Card"
import apartments from "../../datas/Apartments.json"
import styled from "styled-components"

const SectionGallery = styled.div`
display: flex;
flex-direction: row;
justify-content: space-between;
flex-wrap: wrap;
`
function Gallery(){
    return (
        <SectionGallery>
        {apartments.map((apart, id)=> (
            <Card 
            key={`${apart.title}-${id}`}
            picture={apart.cover}
            title={apart.title}

            />
        ))}
        </SectionGallery>
    )
}
export default Gallery
